import PropTypes from 'prop-types'
import Button from './Button'

// props can either be passed props or {name of prop passed}
const Header = ({name}) => {
    return (
        <header>
            {/* curly braces allow us to run javascript */}
            <h1> hi {name}</h1>
            <Button text='Add' colour='green' />
            <Button text='2' colour='red' />
            <Button text='3' colour='blue' />
            <Button text='4' colour='yellow' />
            <Button />
        </header>
    )
}

// proptypes let us force them to pass a certain data structure
Header.propTypes = {
    title: PropTypes.string.isRequired,
}

export default Header
